import React, { useState } from 'react';
import axios from 'axios';
import { Image as ImageIcon, Search, Upload } from 'lucide-react';
import Header from './Header';

// AISearch component: now only renders Google Custom Search Engine widget
const AISearch = () => {
  // Google CSE: dynamically inject script on mount
  React.useEffect(() => {
    if (!document.getElementById('google-cse-script')) {
      const script = document.createElement('script');
      script.id = 'google-cse-script';
      script.async = true;
      script.src = 'https://cse.google.com/cse.js?cx=f7366c081c3b5489b';
      document.body.appendChild(script);
    }
  }, []);

  return (
    <>
      {/* Google Custom Search Engine Widget */}
      <div className="mb-8">
        <div className="gcse-search"></div>
      </div>
    </>
  );
};

export default AISearch;
